import React from "react"

import PrikazKorisnika from "./PrikazKorisnika"

class Users extends React.Component{

    constructor(){
        super()
        this.state = {
            users: []
        }
    }

    componentDidMount(){
        fetch('http://localhost:8080/bioskop/filmovi')
            .then(res => res.json())
            .then(res => {
                this.setState({
                    users: res
                })
            })
    }

    render(){
        const prikaz = this.state.users.map(u => <PrikazKorisnika key={u.korisnickoIme} user={u} />)
        return(
            <div id="Users">
                <table border="1">
                    <thead>
                        <tr>
                            <th>Korisnicko ime</th>
                            <th>Datum registracije</th>
                            <th>Uloga</th>
                        </tr>
                    </thead>
                </table>
            </div>
        )
    }
}

export default Users
